EXHIBIT A
   TO 
SHARED FACILITIES AGREEMENT

The “Shared Facilities” shall consist of the following components of the “Interconnection Customer Interconnection Facilities” (as defined in the LGIA), each of which will be located adjacent to SCE’s Colorado River Substation on real property subject to the United States Department of Interior - Bureau of Land Management Right-of-Way Grant CACA-48811 granted to NextEra Blythe Solar Energy Center (as may be amended): 
1. the 34/220 kV Dracker Switchyard;
2. the Colorado River-Dracker 220kV Transmission Line; 
3. the new optical ground wire (“OPGW”) on the Colorado River-Dracker 220kV Transmission Line to provide one of the two telecommunication paths required for the line protection scheme, the Remote Terminal Unit (“RTU”), and the Special Protection System (“SPS”); 
4. the new single-mode fiber optic cable from the Colorado River Substation to the Generating Facilities, and associated underground vaults, risers, conduits, panels and cable, to provide the second of diverse telecommunications paths required for the line protection scheme and SPS; 
5. all required CAISO approved compliant metering equipment at the Generating Facility; 
6. the revenue metering cabinet(s) and all required revenue metering equipment (typically, voltage and current transformers) at the Generating Facility to meter the Generating Facility’s retail load;
7. the necessary relays and satellite synchronized clock to support the SPS requirements for the Generating Facility; and 
8. the control house (a shared building) that has the individual plant controls, RTU’s and meters.
All other Interconnection Customer Interconnection Facilities shall not constitute “Shared Facilities” for purposes of this Agreement.

